import React, { useState, useEffect } from "react";
// import "./Styles.css";

function Contact() {
  useEffect(() => {
    fetching();
  }, []);
  const [data, setData] = useState([]);
  const fetching = () => {
    fetch(
      `https://corsanywhere.herokuapp.com/https://maps.geoapify.com/v1/staticmap?style=osm-carto&width=600&height=400&center=lonlat:-122.30437832202733,47.526022946038864&zoom=14&apiKey=c9d537a678bb427e998a64fddaebf3aa`
    )
      .then((res) => res.json())
      .then((response) => {
        console.log(response);
        setData(response);
      })
      .catch((err) => {
        console.error(err);
      });
  };
  return (
    <div className="centered">
      <h2>Contact and Map</h2>
      <iframe className="mapContent" src={data.url}></iframe>
    </div>
  );
}

export default Contact;
